column8:
デコレーション用の紙箱です。お好きな布や紙などを貼って素敵にデコレーションしてください。<br><br>◆サイズ（約）：横11cm×高さ17.5cm×奥行8.3cm（屋根奥行10cm）<br>◆素材：紙<br><br>※写真と実際の商品の色とは多少異なる場合があります。<style type="text/css">
