本格和紙を使用しておりますので、色・柄ともに美しく素敵な作品が出来上がります。<br />
詳しい説明書つきですので、どなたにでも手軽に千代紙細工を楽しむことができます。<br />
<ul><li>幅150×奥行き150×高さ4.5mm</li>
<li>できあがりサイズ：幅約5×奥行き約4×高さ約190mm(上部の紐を含む）</li>
<li>キット内容：友禅千代紙3枚、新和染千代紙1枚、民芸和紙4枚、クレープ紙1枚、ぬき型1枚、しおり4枚、リボン1本、説明図1枚</li>
<li>難易度：中級4体分材料入り</li>
<li>素材：紙</li>
<li>日本製</li>
<li>作成に必要な道具：セロハンテープ、はさみ、カッターナイフ、定規、のり、下にしく紙、濡れタオル</li></ul>
<br />
※メーカー希望小売価格はメーカーサイトに基づいて掲載しています。<br />
